////////////////////////////////////////////////////////////////////////////////
//! Defines bit masks what errors shall be ignored during validating the certificate
typedef OTUInt32 EnumCertificateCheck;

//! No validation errors are ignored, i.e. every validation error causes the certificate to be rejected.
static const EnumCertificateCheck EnumCertificateCheck_All	= 0x00000;
//! The certificate is not rejected if the current time is not within the period specified in the certificate
static const EnumCertificateCheck EnumCertificateCheck_SuppressCertificateValidityPeriodCheck	= 0x00040;
//! The certificate is not rejected if the current time is not within the period specified in the revocation list
static const EnumCertificateCheck EnumCertificateCheck_SuppressCrlValidityPeriodCheck = 0x00080;
//! The certificate is not rejected if a CRL is not found
static const EnumCertificateCheck EnumCertificateCheck_SuppressCrlNotFoundError = 0x00100;
//! The certificate is not rejected if the issuer list and trust list don't contain the entire certificate chain to the root certificate.
//! The issuer list only needs to cover the certificate chain from the leaf up to the next trusted certificate.
//! No chain validation takes place if the leaf certificate is in the trust list.
//! Note: This option is not compliant to the OPC UA specification and should only be used to resolve compatibility problems
static const EnumCertificateCheck EnumCertificateCheck_AllowPartialChain = 0x40000;

//! Defines combined masks for EnumCertificateCheck
typedef EnumCertificateCheck CertificateCheckMask;
//! Describes the valid configurable bits of EnumCertificateCheck
static const CertificateCheckMask CertificateCheckMask_AllowedBits = EnumCertificateCheck_SuppressCertificateValidityPeriodCheck | EnumCertificateCheck_SuppressCrlValidityPeriodCheck |EnumCertificateCheck_SuppressCrlNotFoundError | EnumCertificateCheck_AllowPartialChain;

